import React from 'react';
import { Page, Text, Document, StyleSheet, Font } from '@react-pdf/renderer';


Font.register({
  family: "Roboto",
  src:
    "https://cdnjs.cloudflare.com/ajax/libs/ink/3.1.10/fonts/Roboto/roboto-medium-webfont.ttf"
});;

const Report = ({ answers }) => {
  return (
    <Document>
      <Page style={styles.page}>
        <div className={`riskBlock ${answers.first.risk1.cat > 0 ? 'active' : ''}`}>
          {answers.first.risk1.cat > -1 && (
            <div>
              {answers.first.risk1.cat === 0 ? (
                <div className="conclusionOff">
                  <Text style={styles.checkIcon}>✔</Text>
                  <Text style={styles.conclusionTitle}>{answers.first.risk1.ans}</Text>
                </div>
              ) : (
                <div>
                  <Text style={styles.riskTitle}>Риск №1: Право супруга на объект</Text>
                  <div className="conclusion">
                    <Text style={styles.dashIcon}>-</Text>
                    <Text style={styles.conclusionTitle}>{answers.first.risk1.ans}</Text>
                  </div>
                  <div className="Rec">
                    <Text style={styles.recTitle}>Рекомендации:</Text>
                    <Text>Риск 1 рек</Text>
                  </div>
                </div>
              )}
            </div>
          )}
        </div>
        <div className={`riskBlock ${answers.first.risk10.cat > 0 ? 'active' : ''}`}>
          {answers.first.risk10.cat > -1 && (
            <div>
              {answers.first.risk10.cat === 0 ? (
                <div className="conclusionOff">
                  <Text style={styles.checkIcon}></Text>
                  <Text style={styles.conclusionTitle}>{answers.first.risk10.ans}</Text>
                </div>
              ) : (
                <div>
                  <Text style={styles.riskTitle}>Риск №2: фыв</Text>
                  <div className="conclusion">
                    <Text style={styles.dashIcon}></Text>
                    <Text style={styles.conclusionTitle}>{answers.first.risk10.ans}</Text>
                  </div>
                  <div className="Rec">
                    <Text style={styles.recTitle}>Рекомендации:</Text>
                    <Text>Риск 2 рек</Text>
                  </div>
                </div>
              )}
            </div>
          )}
        </div>
        {/* Добавьте другие блоки по аналогии */}
      </Page>
    </Document>
  );
};
  
  const styles = StyleSheet.create({
    page: {
      fontFamily: 'Roboto',
      paddingTop: 30,
      paddingBottom: 30,
      paddingHorizontal: 30,
    },
    checkIcon: {
      fontSize: 36,
      color: 'green',
    },
    conclusionTitle: {
      fontSize: 18,
    },
    dashIcon: {
      fontSize: 36,
      color: 'orange',
    },
    riskTitle: {
      fontSize: 20,
      marginBottom: 10,
    },
    xIcon: {
      fontSize: 36,
      color: 'red',
    },
    recTitle: {
      fontSize: 16,
      fontWeight: 'bold',
      marginBottom: 10,
    },
  });
  
  export default Report;
